// script.js

// Inicjalizacja Signature Pad
var signaturePad, signaturePad2;



// Funkcja wywoływana podczas ładowania strony
window.onload = function () {
  var canvas = document.getElementById('signature-pad');
  var canvas2 = document.getElementById('signature-pad-2')
  signaturePad = new SignaturePad(canvas);
  signaturePad2 = new SignaturePad(canvas2);

  // Konfiguracja przycisku zapisywania podpisu
  document.getElementById('save').addEventListener('click', function () {
    if (signaturePad.isEmpty() || signaturePad2.isEmpty()) {
      alert("Proszę najpierw podpisać.");
    } else {
      var dataURL = signaturePad.toDataURL();
      var dataURL2 = signaturePad2.toDataURL();
      // Wywołujemy generowanie PDF
      generatePDF(dataURL, dataURL2);
    }
  });
};




function getCheckboxValue(checkboxId) {
  const checkbox = document.getElementById(checkboxId);
  return checkbox.checked ? 'TAK' : 'NIE';
}


// Funkcja generująca PDF
function generatePDF(signatureData, signatureData2) {
  //Pobieranie danych
  let investor_name = document.getElementById('investor_name').value;
  let contractor_name = document.getElementById('nazwaPompy').value;
  let subcontractor_name = document.getElementById('mocPompy').value;
  let date = document.getElementById('date').value;

  let bufor = document.getElementById('bufor').value;
  let zbiornikCWU = document.getElementById('zbiornikCWU').value;

 

  const { jsPDF } = window.jspdf;
  const doc = new jsPDF('p', 'mm', 'a4');


  // Załadowanie niestandardowej czcionki
  const customFont = ""; // Zastąp placeholder rzeczywistym stringiem base64 Twojej czcionki
  doc.addFileToVFS('CustomFont.ttf', customFont);
  doc.addFont('CustomFont.ttf', 'CustomFont', 'normal');
  doc.setFont('CustomFont');

  // Tytuł
  doc.setFontSize(11);
  doc.text('PROTOKÓŁ OPCJI DODATKOWYCH', 10, 40, null, null, 'left');
  //Podpisy
  doc.text(`Podpis inwestora`,150, 245 )
  doc.text(`Podpis wykonawcy`,10, 245 )

  // Metadane
  doc.setFontSize(8);
  doc.text(`IMIĘ I NAZWISKO / ADRES BUDOWY: ${investor_name}`, 10, 50);
  doc.text(`NAZWA POMPY CIEPŁA: ${contractor_name}`, 10, 60);
  doc.text(`MOC POMPY CIEPŁA: ${subcontractor_name}`, 10, 70);
  doc.text(`Zbiornik CWU: ${getCheckboxValue('zbiornikCWU')}`, 10, 80);
  doc.text(`Bufor: ${getCheckboxValue('bufor')}`, 10, 90);

  //Data
  doc.text(`Data: ${date}`, 160, 40);

  

  const tableBody = [
    ['1', 'Pompa do cyrkulacji z osprzętem i regulatorem czasowym', '1', 'szt.', getCheckboxValue('lp1')],
    ['2', 'Separator zanieczyszczeń magnetyczny (odmulnik)', '1', 'szt.', getCheckboxValue('lp2')],
    ['3', 'Pompa obiegowa do instalacji C.O. (LFP/WILO) z osprzętem', '1', 'szt.', getCheckboxValue('lp3')],
    ['4', 'Zbiornik ze stali nierdzewnej*', '1', 'szt.', getCheckboxValue('lp4')],
    ['5', 'Regulator pokojowy ..............', '1', 'szt.', getCheckboxValue('lp5')],
    ['6', 'Modem internetowy', '1', 'szt.', getCheckboxValue('lp6')],
    ['7', 'Licznik energii 3f lub 1f', '1', 'kpl.', getCheckboxValue('lp7')],
    ['8', 'Kabel grzewczy z termostatem (i stiglej możliwości podpięcia do kanalizacji lub drenażu po wcześniejszych oględzinach i potwierdzenia przez montera)', '1', 'kpl.', getCheckboxValue('lp8')],
    ['9', 'Krawężnik przemysłowe ułożone na podbudowie pod pompę ciepła:', '1', 'kpl.', getCheckboxValue('lp9')],
    ['10', 'Doprowadzenie kabla siłowego:', '1', 'mb.', getCheckboxValue('lp10')],
    ['11', 'Demontaż starego źródła:', '1', 'kpl.', getCheckboxValue('lp11')],
    ['12', 'Montaż zabezpieczenia UPS do pompy ciepła (zalecane w przypadku pomp typu MONOBLOK)', '1', 'kpl.', getCheckboxValue('lp12')],
    ['13'],
    ['14'],
    ['15']
  ];
  

  // Tabela - przykładowe nagłówki i dane
  doc.autoTable({
    startY: 100,
    head: [['Lp.', 'NAZWA', 'ILOŚĆ', 'MIARA', 'TAK/NIE']],
    body: tableBody,
    

    theme: 'grid',
    styles: {
      cellPadding: 1,
      fontSize: 8, // Możesz dostosować rozmiar czcionki
      font: 'CustomFont'
    },
    headStyles: {
      fillColor: [231,28,36] // RGB wartość zielonego koloru
    },
    columnStyles: {
      0: { cellWidth: 6 },
      1: { cellWidth: 120 },
      2: { cellWidth: 15 },
      3: { cellWidth: 15 },
      4: { cellWidth: 15 },
      
    },
        didDrawPage: function (data) {
            // Możliwe dodatkowe modyfikacje dla każdej strony
        }
    });

  

  // Dodajemy podpis w prawym dolnym rogu strony
  var signatureWidth = 60; // szerokość podpisu w mm
  var signatureHeight = 30; // wysokość podpisu w mm
  doc.addImage(signatureData, 'PNG', 210 - signatureWidth - 20, 297 - signatureHeight - 20, signatureWidth, signatureHeight);
  doc.addImage(signatureData2, 'PNG', 90 - signatureWidth - 20, 297 - signatureHeight - 20, signatureWidth, signatureHeight);
  
  //logo
  const logo = '';
  doc.addImage(logo, 'PNG', 170, 5, 30, 30);

  // Zapisujemy wygenerowany PDF
  doc.save('protokol-opcji-dodatkowych.pdf');
}
